    false,nt"url": null,nt"notes": "EM300 and EM3002D multibeam Data were collected
    from May 12-22, 2007, aboard NOAA Ship Hi'ialakai at Santa Rosa Reef, Guam Island,
    Rota Island, Aguijan Island, Tinian Island, and Saipan Island during cruise HI0702.
    These multibeam data were collected using SAIC ISS-2000 software in the Generic
    Sensor Format and processed using SABER editing software. Surface sound velocity
    values were supplied by a Seabird SBE-45 MicroTSG and a SBE-38 remote temperature
    probe. Sound velocity corrections from a Seabird 911 CTD sensor and motion corrections
    from a POS-MV vertical reference were applied to the data in real time. Predicted
    tides were applied to the data in real time. Horizontal accuracy is 20 m (no differential
    GPS correctors applied), vertical accuracy is depth dependent (~1% of water depth),
    WGS84 datum. These data are not to be used for navigation. Depths mapped range from
    ~20-3000 m. Concurrent mapping at Santa Rosa Reef, Guam Island, Rota Island, Tinian
    Island, and Saipan Island was done by the R/V AHI in water depths ranging from ~10-350m
    with the data set being AHI0702; (metadata for AHI0702 are submitted separately.)",nt"owner_org":
